    false,nt"url": null,nt"notes": "These data were collected in April of 2000
    for the Cayuga County New York Department of Planning and Economic Development.
    Elevation points were sampled at densities necessary to support the generation of
    contours that meet or exceed United States National Map Accuracy Standards applicable
    to the map scales that County tax maps are published and for the following intervals
    of contour lines to be depicted: four feet for the entire county, two feet for the
    City of Auburn and adjacent area and two feet for six floodplain areas. This is
    a bare earth data set, the points, however, are classified as "Never Classified".
    There are points returned from water surfaces. Point spacing is approximately 5
    m. Also, there are areas in the county where the data have been regularized, i.e.
    gridded points.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
